import React from 'react';
import { AiFillCaretRight } from "react-icons/ai";
import './Btn.css';

const Btn = ({ handlePrevPage, handleNextPage }) => {
	return (
		<div className='btn'>
			<button onClick={handlePrevPage}>PREV</button>
			<button onClick={handleNextPage}>
				NEXT
				<span>
				<AiFillCaretRight/>

				</span>
			</button>
		</div>
	);
};

export default Btn;
